const Wrapper = styled.div`
  clear: both;
  position: fixed;
  bottom: 0;
  height: 3.5rem;
  width: 100%;
  background: #202124;
  color: #6BA5ED;
  margin-top: -3.5rem;
`

const Content = styled.div`
  text-align: center;
`

// <h1>DO THE FIVE. <small>Help stop coronavirus</small></h1>

export default () => (
  <Wrapper>
    <Content>
      <h1>DO THE FIVE: &nbsp;&nbsp;&nbsp; <small>1. STAY <i>home</i> &nbsp;&nbsp; 2.KEEP <i>distance</i> &nbsp;&nbsp; 3. WASH <i>hands often</i> &nbsp;&nbsp; 4. COVER <i>your cough</i> &nbsp;&nbsp;  5. SICK? <i>call ahead!</i></small></h1>
    </Content>
  <style jsx>{`
    small {
      font-size: 10px;
    }
  `}</style>
  </Wrapper>
)
